import React from 'react';
import Field from "./Field"

class Login extends React.Component{
    render(){
        return (<div className='login'>
         <Field remark="userName"  content={this.handlePasswordInsertion} />
            <Field remark="password"  content={this.handlePasswordInsertion} />
            <div className="button_cont" align="center">
     <a class="example_f" href="http://localhost:3000/Register" target="_blank" rel="nofollow">
     <span>Login</span></a></div>
        </div>)

    }
}

export default Login;
